let prevScrollpos = window.pageYOffset;
window.onscroll = function () {
    let currentScrollPos = window.pageYOffset;
    if (prevScrollpos > currentScrollPos) {
        document.getElementById("navbar").style.top = "0";
    } else {
        document.getElementById("navbar").style.top = "-100px";
    }
    prevScrollpos = currentScrollPos;
}

body {
    margin: 50px 0 0 0;
    font-family: 'Ubuntu', sans-serif;
}

.navbar {
    position: absolute;
    z-index: 99999;
    overflow: hidden;
    background-color: #ff9800;
    position: fixed;
    top: 0;
    width: 100%;
    transition: top 0.3s;
}

.navbar a {
    float: left;
    display: block;
    color: #f2f2f2;
    text-align: center;
    padding: 14px 16px;
    text-decoration: none;
    font-size: 17px;
}

.navbar a:hover {
    background: #ddd;
    color: black;
}

@media screen and (max-width: 960px) {
  .navbar a {
    font-size: 13px;
  }
}

* {
    box-sizing: border-box;
}

.column {
    position: relative;
    float: left;
    width: 33.33%;
    padding: 5px;
}

.row::after {
    content: "";
    clear: both;
    display: table;
}

.image {
    display: block;
    width: 100%;
    height: auto;
}

.overlay {
    position: absolute;
    bottom: 100%;
    left: 0;
    right: 0;
    background-color: #ff8000;
    overflow: hidden;
    width: 100%;
    height: 0;
    transition: .3s ease;
}

.column:hover .overlay {
    bottom: 0;
    height: 100%;
}

.text {
    color: white;
    font-size: 20px;
    position: absolute;
    top: 50%;
    left: 50%;
    -webkit-transform: translate(-50%, -50%);
    -ms-transform: translate(-50%, -50%);
    transform: translate(-50%, -50%);
    text-align: center;
}

.text a {
    color: white;
}

@media screen and (max-width: 960px) {
    .column {
        width: 100%;
    }
}
